create table tbl_morada(
moradaId int not null auto_increment primary key,
nomeMorada varchar(20) not null,
morada varchar(250) not null,
numeroMorada varchar(10) not null,
complementoMorada varchar(5),
freguesiaMorada varchar(50) not null,
conselhoMorada varchar(50) not null,
distritoMorada varchar(50) not null,
cpMorada varchar(8) not null,
paisMorada varchar(50) not null
);

Create table tbl_user_morada(
userMoradaId int not null auto_increment primary key,
userId int not null,
moradaId int not null,
KEY user_morada_user_FK (userId),
CONstraint user_morada_user_FK FOReign keY (userId)
        REFerences tbl_users (userId),
KEY user_morada_morada_FK (moradaId),
    CONstraint user_morada_morada_FK FOReign keY (moradaId)
        REFerences tbl_morada (moradaId)
);

Create table tbl_status(
statusId int not null auto_increment primary key,
statusDesc varchar(20) not null
);

insert into tbl_status values( 1, 'Aguardando envio'),
(2,'Enviado'),
(3, 'Cancelado');

create table tbl_encomendas(
encomendaId int not null auto_increment primary key,
userId int not null,
moradaId int not null, 
dataEncomenda datetime not null default now(),
statusId int not null default 1,
KEY status_encomenda_FK (statusId),
CONstraint status_encomenda_FK FOReign keY (statusId)
        REFerences tbl_status (statusId)
);

create table tbl_encomenda_products(
encomendaProductsId int not null auto_increment primary key,
encomendaId int not null,
productId int not null,
productQtt int not null,
KEY encomenda_product_encomenda_FK (encomendaId),
CONstraint encomenda_product_encomenda_FK FOReign keY (encomendaId)
        REFerences tbl_encomendas (encomendaId),
KEY encomenda_product_product_FK (productId),
CONstraint encomenda_product_product_FK FOReign keY (productId)
        REFerences tbl_products (productId)
);

